import React, { useEffect } from "react";
import Variants from "./Variants";

const Vendor = ({ vendor }) => {
  console.log(vendor, "vendor component");
  const [variants, setSetVariants] = React.useState([]);

  useEffect(
    (vendor) => {
      const variantStrings = vendor.vendors
        .map((vendor) => {
          const variants = vendor.variants;
          const variantStringsForVendor = variants
            .map((variant) => {
              const variantEntries = Object.entries(variant);
              const variantStrings = variantEntries
                .map(([key, value]) => `${key}: ${value}`)
                .join(", ");
              return variantStrings;
            })
            .join(", ");
          return `${vendor.nameV}: ${variantStringsForVendor}`;
        })
        .join("\n");

      setSetVariants(variantStrings);
    },
    [setSetVariants]
  );
  return (
    <div className="vendor-detail">
      <Table>
        <thead>
          {product.vendors.map((vendor) => (
            <tr>
              <th>{vendor.nameV}</th>
            </tr>
          ))}
        </thead>
        <tbody>
          <tr>
            <td>{variants}</td>
          </tr>
        </tbody>
      </Table>
      {vendor &&
        vendor.lenght > 0 &&
        vendor?.map((item) => (
          <React.Fragment key={item.id}>
            <Variants vendor={item} />
          </React.Fragment>
        ))}
    </div>
  );
};

export default Vendor;
